Verenigde Staten
Drama
99 minuten

goed

met Edward Burns, Connie Britton en Tom Guiry

Zeven volwassen broers en zussen uit een Iers-Amerikaans arbeidersgezin krijgen te maken met het verlangen van hun vervreemde 
vader, die terug naar huis wil komen voor kerst, nadat hij hen 20 jaar eerder verlaten heeft. De vier oudste waren volwassen toen 
hun vader Big Jim (Ed Lauter) hun verliet, terwijl de jongere kinderen nooit een relatie hebben gehad met hem, en nog steeds 
lijden onder zijn vertrek. Maar net als bij elk gezin zorgt Kerstmis voor een gecompliceerde familie dynamiek.
